aipAPI.prototype.checkBidders = function() {
	var aRemoveBidders = [];

	//exclude bidders from country
	var excludeBidders = {
		'pubmatic': ['RU', 'UA', 'BY', 'RS', 'VE', 'LB', 'BA', 'MK', 'AL', 'IQ', 'ZW', 'ME', 'TM', 'PF', 'TJ', 'LY', 'SO', 'GP', 'AX', 'YE', 'AD', 'CD', 'MC', 'GA'],
		'rhythmone': ['TR', 'ID', 'VN', 'EG']
	};
	for (const key in excludeBidders) {
		if(aipAPItag.inArray(this.CountryCode, excludeBidders[key])!= -1){
			aRemoveBidders.push(key);
			aipAPItag.log("Removing bidder "+key+" from all AdUnits because user is from: "+this.CountryCode);
		}
	}
	
	//exclude bidders from iframe
	/*
	if(this.inIframe()) {
		var excludeBiddersIframe = [
			"conversant"
		];
		excludeBiddersIframe.forEach(function(key) {
			aRemoveBidders.push(key);
			aipAPItag.log("Removing bidder "+key+" from all AdUnits because page is in an iframe");
		})
	}
	*/

	//include bidder in countries only
	/*
	var includeBidders = {
		'33across': ['US', 'CA', 'AU']
	};
	for (const key in includeBidders) {
		if(aipAPItag.inArray(this.CountryCode, includeBidders[key])== -1){
			aRemoveBidders.push(key);
			aipAPItag.log("Removing bidder "+key+" from all AdUnits because user is from: "+this.CountryCode);
		}
	}
	*/
	
	//remove rubicon when in iframe
	if(this.inIframe()) {
		aRemoveBidders.push("rubicon");
	}

	//removeBidders
	if(aRemoveBidders.length > 0) {
		//removeBidders from display
					this.removeBidders(this.adUnits['missing11-com_320x50'], aRemoveBidders);
					this.removeBidders(this.adUnits['missing11-com_120x20_1'], aRemoveBidders);
					this.removeBidders(this.adUnits['missing11-com_120x20_2'], aRemoveBidders);
					this.removeBidders(this.adUnits['missing11-com_300x50_1'], aRemoveBidders);
					this.removeBidders(this.adUnits['missing11-com_300x50_2'], aRemoveBidders);
					this.removeBidders(this.adUnits['missing11-com_970x90'], aRemoveBidders);
		
		//removeBidders from preroll
						this.removeBidders([this.videoAdUnit["missing11.com_preroll"]], aRemoveBidders);
					}
}

